// src/components/Input.js

import React from 'react';

function Input({ label, type, name, value, onChange, required = false }) {
  return (
    <div className="form-group">
      <label htmlFor={name}>{label}</label>
      <input
        type={type}
        id={name}
        name={name}
        value={value}
        onChange={onChange}
        required={required}
      />
    </div>
  );
}

export default Input;
